import { Avatar } from '@material-ui/core';
import React from 'react'
import styled from 'styled-components';

const Divcontainer = styled.div`
  width:100%;
  margin-top:15px;
  border-radius:15px;
  background-color:white;
  box-shadow:0px 5px 7px -7px rgba(0,0,0,0.75)
`
const TopContainer = styled.div`
  display:flex;
  align-items:center;
  position:relative;
  padding:15px;
`
const BottomContainer = styled.div``
const TopContainerInfo =  styled.div``
const Images = styled.div`

img{
  width:100%;
}
`
const Post = ({ profilePic, username, price, images, timestamp, phon ,message}) => {
  return (
    <Divcontainer>
      <TopContainer>
        <Avatar src={profilePic} />
        <TopContainerInfo>
          <h3>{username}</h3>
          <p>Timestamp...</p>
        </TopContainerInfo>
      </TopContainer>

      <BottomContainer>
        <p>{ price}</p>
        <p>{ phon}</p>
        <p>{ message}</p>
      </BottomContainer>
      <Images>
        <img src={images} alt=""/>
      </Images>
    </Divcontainer>
  )
}

export default Post
